import React from 'react';

function Header () {

    return 
        (
            <>
                <meta name="viewport" content="width=device-width, initial-scale=1"></meta>
                <meta http-equiv="X-UA-Compatible" content="IE=edge"></meta>
                <meta charset="UTF-8"></meta>
                <title>Safs - HTML</title>
                {/* <!-- ====== Google Fonts ====== --> */}
                <link href="https://fonts.googleapis.com/css?family=Source+Sans+Pro:300,400,600" rel="stylesheet"></link>
                {/* <!-- ====== ALL CSS ====== --> */}
                <link rel="stylesheet" href="assets/css/bootstrap.min.css"></link>
                <link rel="stylesheet" href="assets/css/fontawesome-all.min.css"></link>
                <link rel="stylesheet" href="assets/css/lightbox.min.css"></link>
                <link rel="stylesheet" href="assets/css/owl.carousel.min.css"></link>
                <link rel="stylesheet" href="assets/css/animate.css"></link>
                <link rel="stylesheet" href="style.css"></link>
                <link rel="stylesheet" href="assets/css/responsive.css"></link>
            </>
        );
}

export default Header;
